INSERT INTO `md_config` VALUES ('1', 'test.com', '中国创业者大会', '中国创业者大会', '/uploads/logo/20180604/3cd62ffbdb13297ed5d58b79ad3b852e.png', '957', '中国创业者大会', '豫ICP备 123456号', '', '', '');
INSERT INTO `md_content` VALUES ('1', '1', '简介', '', '', '<p align=\"left\">大会背景<br>为响应李克强总理“大众创新、万众创业”的国家号召，以引领中部地区创业者群体发展、打造创业新态势的中国（河南）创业者大会连续成功举办五届。截止目前，中国创业者大会参会报名人数从第一届的6000人次迅速增长至第五届的75000人次，总体累计报名人数超20万，覆盖国内外35万余家企业。其影响力急剧增长的背后，不仅代表着中部地区创新驱动发展的骄人成绩，更已成为河南经济飞跃发展的新“名片”。</p><p align=\"left\"><br>大会亮点<br>以汇聚行业精英、促进技术交流、加深商务合作、推动行业发展为大会宗旨，定位为专业、开放、国际化的大型会议会展平台，本届大会以高品质的会议内容和多元化的展现形式令参会企业及个人能够更加准切的把握行业最新趋势，构建资源共享，深化宣传与合作，实现多方共赢。</p><p align=\"left\">重磅嘉宾：大会主会场将邀请到国内行业最具影响力的人物，共同探讨分享最前沿的技术信息。<br>前沿讯息：内容将涉及AI、AR/VR、新经济、新生态、新物种、产业升级等等重磅热点分享和未来发展趋势。让与会嘉宾全方位领略、感受世界领先技术，让思想和智慧激荡出风暴。<br>交流合作：打造顶级商务社交平台，为参会企业及嘉宾提供高质量交流与接洽的机会，真正实现零距离交流，共同畅谈行业前景，营造技术交流分享合作的PARTY。<br>精彩展区：展现惊艳的视觉效果与创新产品体验，参展团队与嘉宾进行亲密沟通交流，嘉宾在轻松愉悦的氛围中玩味互联网前沿技术。<br></p><p><span><br></span></p>', '1528711186');
INSERT INTO `md_content` VALUES ('2', '2', '议程', '议程', '大会议程', '<p>精彩内容，敬请期待</p><p>组委会电话：0371/55555286</p>', '1528711161');
